import { Divider, Toolbar, Typography } from '@mui/material'
import React from 'react'

export default function Home() {
  return (
    <>
      <Toolbar >
        <Typography variant='h6' >Features of My Bank</Typography>
      </Toolbar>
      <Divider />
    </>
  )
}
